function buscarInforme() {

    //cambia el titulo 
    $("#tituloModulo").html(' : \"' + $("#SelectInforme option:selected").text()+ ' \"');


    var i;
    var subi;
    if ($("#idSubInforme").val() > 0 || $("#idSubInforme").val() != "") {
        i = $("#idSubInforme").val();
        subi = true;
    } else {
        i = $("#idInforme").val();
        subi = false;
    }
    getInformeConfig(i, subi);
    var filtros = new Object
    filtros.idInforme = i;       
    filtros.fechaDesde = $('#datepicker1').val();
    filtros.fechaHasta = $('#datepicker2').val();

        //filtros.fechaDesde = $('#datepicker1').val() != "" ? 

    
    filtros.idMedico = 1
    filtros.documentoMedico = 1
    filtros.idEspecialidad = $("#idEspecialidad").val();
    filtros.idPaciente = 1
    filtros.documentoPaciente = $("#dniPaciente").val() || 0;
    filtros.documentoMedico = $("#dniMedico").val() || 0;
    $.ajax({
        type: 'get',         
        url: baseUrl + '/Informes/getInforme',
        data: {
            idInforme: filtros.idInforme,
            fechaDesde: filtros.fechaDesde,
            fechaHasta: filtros.fechaHasta,
            idMedico: filtros.idMedico,
            documentoMedico: filtros.documentoMedico,
            idEspecialidad: filtros.idEspecialidad,
            idPaciente: filtros.idPaciente,
            documentoPaciente: filtros.documentoPaciente
        },
        cache: false,
        dataType: 'json',
        success:  function (r) {         
            if (r.data != "null" && r.result) {
                bindInforme(r.data, 'tblInforme' );
            }else{
                $('.clock-pacientes').addClass('hide');
                toastr.error('No se encontraron datos, reintente.')
            }
        },
        error: function (jqXHR, textStatus, errorThrown) {
            toastr.error('Error - ' + errorThrown);
        }
    });

}

function getInformeConfig(i, subi) {
    configInforme = JSON.parse('{"idInforme":0,"nombre":"SIGESAN","observaciones":"","titulo":"SISTEMA DE GESTIÓN SANITARIA","subtitulo":"","orientacionPapel":"landscape","tamañoPapel":"legal","subInforme":false,"fuente":null,"idUsuario":null,"activo":null,"habilitarDistinct":null,"InformeColumnas":[],"InformesSubInformes":[]}');
    $.ajax({
        type: 'get',
        url: baseUrl + '/Informes/getInformeConfig',
        data: { idInforme: i, subInforme: subi },
        cache: false,
        dataType: 'json',
        success: function (r) {
            if (r.result) {
                configInforme = JSON.parse(r.data)                
            }

        },
        error: function (jqXHR, textStatus, errorThrown) {
            toastr.error('Error - ' + errorThrown);
        }
    });
  //  return configInforme;
}

function bindInforme(datosJson,oTable) {
        datosJson = JSON.parse(datosJson);
   
        var th_ini = "";
        var tr_ini = "";
        var thjson = "";

        if ((typeof (datosJson) !== 'undefined') && (datosJson.length > 0)) {

            // CABECERA DE TABLA
            for (h in datosJson[0]) { thjson += "<th> " + h + " </th>"; }
            th_ini += "<tr>" + thjson + "</tr>";
            var valor = 0;
            // CUERPO DE TABLA
            for (x in datosJson) {
                tr_ini += "<tr>";
                for (y in datosJson[x]) {
                    valor = datosJson[x][y];
                    tr_ini += "<td> " + valor + " </td>";
                }
                tr_ini += " </tr>";
            }


            if ($.fn.dataTable.isDataTable('#' + oTable)) {
                table = $('#' + oTable).DataTable();
                table.destroy();
                $('#' + oTable + ' thead tr').remove();
                $('#' + oTable + ' thead').append(th_ini);
                $('#' + oTable + ' tbody tr').remove();
                $('#' + oTable + ' tbody').append(tr_ini);
                tablaAd(oTable);
               
            } else {
                $('#' + oTable + ' thead').append(th_ini);
                $('#' + oTable + ' tbody').append(tr_ini);
                tablaAd(oTable);
            }
            var valores = '';
            $('#tblInforme thead tr').each(function (index) {
                $(this).children("th").each(function (index2) {
                    switch (index2) {
                        case 0: valores = $(this).text();
                            break;
                        default:
                            valores = valores + ',' + $(this).text();
                    }
                })
            })
            $("#infomeColum").val('' + valores + '');

        } else {
           
            toastr.warning('No se encontraron datos...');
          
        }   
    };

